        self.sbCarLasting.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>Minimum lasting for a carrier fake. It applies to filters CAR1 and CAR2</p></body></html>"))
        self.sbCarLasting.setSuffix(_translate("ebrowWindow", " S"))
        self.chkCarrierFilter1.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>Carrier filter 1</p><p><br/></p><p>This filter discriminates fake events due to radar carrier or other artificial emissions with vertical pattern at center frequency. </p><p>Filter 1 works on the ratio between the echo area and the interval area covered. Fixed carriers tend to have very small echo area, being narrow and regular.</p><p>In order to compare with the interval area, this is divided by the detection range first, in order to let the filter work with any detection range setting.</p><p>If the resulting value in below the given threshold, it means it\'s a carrier.</p></body></html>"))
        self.chkCarrierFilter1.setText(_translate("ebrowWindow", "Enable carriers filter 1"))
        self.label_55.setText(_translate("ebrowWindow", "Carrier filter1 threshold"))
        self.sbCar1Threshold.setSuffix(_translate("ebrowWindow", "%"))
        self.chkCarrierFilter2.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>Carrier filter 2</p><p><br/></p><p>This filter discriminates fake events due to radar carrier or other artificial emissions with vertical pattern at center frequency. </p><p>Filter 2 finds carriers by checking the istantaneous difference S-N against its average.</p><p>If they are too close, into the given percentage, the event is a carrier.</p></body></html>"))
        self.chkCarrierFilter2.setText(_translate("ebrowWindow", "Enable carriers filter 2"))
        self.label_56.setText(_translate("ebrowWindow", "Carrier filter2 threshold"))
        self.sbCar2Threshold.setSuffix(_translate("ebrowWindow", "%"))
        self.chkESDfilter.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>This filter could help discriminating fake events due to lightings or electrostatic discharges (ESD)</p><p>ESD appear on waterfall like an horizontal stripe covering the entire bandwidth, <br/>with variable duration, depending of its cause: human (i.e. electric motors) <br/>or natural(lightings). </p><p>For this reason ESD events tend to fill up all the interval area and </p><p>consequently the ratio between interval area and echo area is close to 1 = 100%</p><p>The filter checks if this ratio is above the given threshold, otherwise the </p><p>event is marked as ESD</p><p><br/></p></body></html>"))
        self.chkESDfilter.setText(_translate("ebrowWindow", "Enable ESD filter"))
        self.label_57.setText(_translate("ebrowWindow", "ESD filter threshold      "))
        self.sbESDthreshold.setSuffix(_translate("ebrowWindow", "%"))
        self.chkSatFilter.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>Saturation filter</p><p><br/></p><p>Strong signals near the receiver site, even on different frequencies</p><p>than Echoes tuned frequency can cause receiver saturations, that</p><p>are detected by checking the average S falling down suddendly.</p><p>The filter works by storing the average S recorded on any event.</p><p>That stored value becomes the reference level. If in a new event,</p><p>the average S falls below the reference, exceeding the given tolerance</p><p>threshold, the event is classified as saturation.</p><p><br/></p></body></html>"))
        self.chkSatFilter.setText(_translate("ebrowWindow", "Enable saturation filter"))
        self.label_58.setText(_translate("ebrowWindow", "Saturation filter threshold"))
        self.sbSATthreshold.setSuffix(_translate("ebrowWindow", "%"))
        self.chkRFIfilter.setToolTip(_translate("ebrowWindow", "<html><head/><body><p>RFI filter</p><p><br/></p><p>This filter discriminates fake events due to artificial emissions with horizontal pattern spreading the entire frequency coverage.</p><p>Such disturbances cause quick and oscillating N variations, despite the averaging value set <br/>with <span style=\" font-style:italic;\">Averaged Scans </span>control in Echoes. Such variations are revealed with the <span style=\" font-style:italic;\">std_dev</span> value, normally close to zero, that increments above the threshold set</p></body></html>"))
        self.chkRFIfilter.setText(_translate("ebrowWindow", "Enable RFI  filter"))
        self.label_66.setText(_translate("ebrowWindow", "RFI filter threshold"))
